@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix : <http://www.example.com/> .

:HealthcarePortal a owl:Class .
:Doctor a owl:Class .
:Image a owl:Class .
:upload a owl:ObjectProperty ;
         rdfs:domain :Doctor ;
         rdfs:range :Image .

:DiagnosticImage a owl:Class ;
                 rdfs:subClassOf :Image .

[ a owl:Axiom ;
  owl:propertyChainAxiom (:upload :DiagnosticImage) ;
  owl:equivalentClass :HealthcarePortal ] .
